import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int t = scanner.nextInt();
        scanner.nextLine();

        for (int i = 0; i < t; i++) {
            String[] input = scanner.nextLine().split(" ");
            long[] numbers = new long[9];
            for (int j = 0; j < 9; j++) {
                numbers[j] = Long.parseLong(input[j], 16);
            }

            long sum = 0;
            for (int j = 0; j < 8; j++) {
                sum = (sum + numbers[j]) % (1L << 32);
            }

            long key = 0;
            for (int j = 0; j < 8; j++) {
                if ((sum & 1) != (numbers[8] & 1)) {
                    key |= 1L << j;
                }
                sum >>= 1;
                numbers[8] >>= 1;
            }

            System.out.println(Long.toHexString(key));
        }
    }
}
